import React from 'react';
import './App.css';
import Toastcontainer from './components/common/Toastcontainer';
import Addcourt from './pages/Addcourt';
import CourtUserViewPage from './pages/CourtUserViewPage';
import Home from './pages/Home';
import Login from './pages/Login';
import MyGroupsPage from './components/common/myplayer';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom'; // Import Link from react-router-dom
import { AdminAuth, LoginAuth, UserAuth } from './Authorization/authorization';

function App() {
  return (
    <div className="App">
      <Toastcontainer/>
      <BrowserRouter>
        <nav>
          {/* Link to scroll to Players section */}
          <Link to="/home#players">Players</Link>
        </nav>
        <Routes>
          {/* Login */}
          <Route element={<LoginAuth/>}>
            <Route path='/' element={<Login/>} />
          </Route>

          {/* User Routes */}
          <Route element={<UserAuth/>}>
            <Route path='/home' element={<Home/>} />
            <Route path='/courtUserViewPage/:id' element={<CourtUserViewPage/>} />
            <Route path='/groups' element={<MyGroupsPage/>} />
          </Route>

          {/* Admin Routes */}
          <Route element={<AdminAuth/>}>
            <Route path='/addcourt' element={<Addcourt/>} />
          </Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
